    "2013-03-16T00:25:03.672482",nt"name": "geology-of-the-mount-mansfield-quadrangle-vermont",nt"isopen":
    false,nt"url": null,nt"notes": "This resource is available as a downloadable
    file, ESRI Service, and as a Web Feature service. Resource includes a Bedrock map,
    Structure map, Surficial map, and a text for the Bedrock geology of the Mount Mansfield
    Quadrangle, Vermont. Abstract: The rocks in the Mount Mansfield quadrangle were
    deposited in a Cambrian eugeosyncline principally as graywacke, siltstone and shale
    with minor amounts of volcanic, calcareous and carbonaceous material. Rocks in the
    western part are coarser and include local beds of quartz  conglomerate, "shale
    conglomerate," and many coarse gravwackes  associated with graded beds. Eastward
    across the quadrangle the rocks  become finer grained. Within this sequence older
    strata containing lava  and volcanic detrital rocks belong to the Tibbet Hill unit
    and younger  rocks containing carbonaceous material and limestone belong to the
    Ottauquechee formation. The remaining portions of the sequence belong  to the Camels
    Hump group which could not be differentiated.",nt"license_title": null,nt"extras":
